function LoadingScreen(){
	State.constructor.call(this);
	this.alwaysUpdate = false;
	
	this.updateState = function(delta){
		Resources.getLeftToLoad();
		//print(Resources.leftToLoad+"Loading ");
	}
	
	var loader = new Sprite();
	loader.x = 200;
	loader.y = 300;
	loader.lrot = 0;
	loader.update = function(delta){
		this.x = canvas.width/2;
		this.y = canvas.height/2+Math.sin(this.lrot)*10;;
	}
	this.world.addChild(loader);
	
	var logo = new Sprite();
	logo.width = 256;
	logo.height = 256;
	logo.x = 0;
	logo.y = -logo.height/2;
	loader.addChild(logo);
	this.logo = logo;
	
	var logoBot = new Sprite();
	//logoBot.image = Textures.load(logoBotData);
	logoBot.image = Textures.load(logoTopData, false, false);
	logoBot.width = 256;
	logoBot.height = 256;
	logoBot.offsetX = -logoBot.width/2;
	//logoBot.offsetY = -logoBot.height/2;
	logo.addChild(logoBot);
	
	var logoTop = new Sprite();
	//logoTop.image = Textures.load(logoTopData);
	logoTop.image = Textures.load(logoBotData, false, false);
	//logoTop.image = Textures.load(logoFillData);
	logoTop.width = 256;
	logoTop.height = 256;
	logoTop.offsetX = -logo.width/2;
	logoTop.offsetY = 0;//-(logo.height)/2+height/2;
	logoTop.init = 80;
	logoTop.total = 96;
	logoTop.cent = 0.5;//1.0;
	//logoTop.alpha = 0.75;
	logoTop.aRot = 0;
	
	logoTop.height = 128;
	logoTop.sliceY = logoTop.height;
	//logoTop.sliceHeight = 25;
	//logoTop.sliceWidth = 128;
	
	var flashSpeed = 0.025;
	logoTop.draw = function(ctx){
		ctx.drawSprite(this);
		
		this.height = this.init+this.total*(1.0-this.cent);
		//this.sliceHeight = this.height;
		logoTop.sliceY = logo.height-this.height;
		
		this.offsetY = logo.height-this.height;
		
		this.aRot += flashSpeed;
		this.alpha = 0.5+Math.abs(Math.sin(this.aRot)*0.5);
	}
	logo.addChild(logoTop);
	this.logoTop = logoTop;
}

LoadingScreen.prototype = new State();

var fillSpeed = 0.05;
var fadeSpeed = 0.01;
LoadingScreen.prototype.update = function(delta){
	var percent = (Resources.leftToLoad/Resources.totalItems);
	if(this.logoTop.cent > percent){
		this.logoTop.cent -= fillSpeed*delta;
	}
	this.logoTop.cent = Math.max(0, this.logoTop.cent);
	
	if(this.logoTop.cent <= 0){
		this.logoTop.total = this.logo.height-this.logoTop.init;
		//this.logoTop.cent = 1.0;
		//this.logoTop.alpha = 0;
		if(this.logo.alpha > 0){
			this.logo.alpha -= fadeSpeed*delta;
		}else{
			this.onLoadComplete();
		}
	}
	State.prototype.update.call(this, delta);
}

LoadingScreen.prototype.onLoadComplete = function(){
	println("Loading complete");
}

